Neighbor Affair - Cameron Dee
Added: November 14, 2014

Ike is pretty upset that his neighbor, Cameron Dee, has been taking his girlfriend out and bringer her back in the wee hours of the morning. Cameron thinks she knows what the problem is. It's not that Ike is mad at Cameron for taking his girl out, it's that Ike is jealous since he doesn't get to spend any time with Cameron. Cameron has the perfect solution, she'll continue to take Ike's girl out at night and fuck Ike during the day. Sounds like the perfect plan to Ike
